from __future__ import absolute_import, division

import numpy as np

from ..constants import ZGLOBAL
from .plate2d import area_of_polygon
from .read_mesh import getMid


def add_k0s(k0, trias, prop_from_node):
    print('Adding K0s to K0...')
    dof = 5
    for tria in trias:
        # n1 -> n2 -> n3 -> n1
        # sub-tria1: mid -> n1 -> n2
        # sub-tria2: mid -> n2 -> n3
        # sub-tria3: mid -> n3 -> n1

        n1, n2, n3 = tria.nodes
        mid = getMid(tria)

        if np.dot(np.cross((n1.xyz - mid), (n2.xyz - mid)), ZGLOBAL) < 0:
            n1, n2, n3 = n2, n1, n3

        #TODO calculate triangle area here, in case nodes coordinate are updated
        #     during solution
        Ac = tria.get_area()

        # sub-tria 1
        x1, y1, z1 = mid
        x2, y2, z2 = n1.xyz
        x3, y3, z3 = n2.xyz
        a1 = x2 - x1
        b1 = y2 - y1
        c1 = x3 - x1
        d1 = y3 - y1
        tmp = np.array([mid, n1.xyz, n2.xyz])
        Ac1 = area_of_polygon(tmp[:, 0], tmp[:, 1])

        # sub-tria 2
        x1, y1, z1 = mid
        x2, y2, z2 = n2.xyz
        x3, y3, z3 = n3.xyz
        a2 = x2 - x1
        b2 = y2 - y1
        c2 = x3 - x1
        d2 = y3 - y1
        tmp = np.array([mid, n2.xyz, n3.xyz])
        Ac2 = area_of_polygon(tmp[:, 0], tmp[:, 1])

        # sub-tria 3
        x1, y1, z1 = mid
        x2, y2, z2 = n3.xyz
        x3, y3, z3 = n1.xyz
        a3 = x2 - x1
        b3 = y2 - y1
        c3 = x3 - x1
        d3 = y3 - y1

        tmp = np.array([mid, n3.xyz, n1.xyz])
        Ac3 = area_of_polygon(tmp[:, 0], tmp[:, 1])

        k = 5/6
        if prop_from_node:
            pn1 = n1.prop
            pn2 = n2.prop
            pn3 = n3.prop
            G = k * (1/3*pn1.E*pn1.t**2 + 1/3*pn2.E*pn2.t**2 + 1/3*pn3.E*pn3.t**2)
        else:
            G = k * tria.prop.E * tria.prop.t**2
        G44 = G[0, 0]
        G45 = G[0, 1]
        G55 = G[1, 1]

        i1 = n1.index
        i2 = n2.index
        i3 = n3.index

        k0[i1*dof+2, i1*dof+2] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2)/Ac
        k0[i1*dof+2, i1*dof+3] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3)))/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(-a1*c1/4 + a3*c3/4)/Ac
        k0[i1*dof+2, i1*dof+4] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(b1*d1/4 - b3*d3/4)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(0.166666666666667 - b1*c1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 + a3*d3/(4*Ac3)))/Ac
        k0[i1*dof+2, i2*dof+2] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(-b1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac2*(d2/(2*Ac2) + 0.166666666666667*(b2 - d2)/Ac2) + 0.166666666666667*b3 - 0.166666666666667*d3)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(a1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac2*(-c2/(2*Ac2) + 0.166666666666667*(-a2 + c2)/Ac2) - 0.166666666666667*a3 + 0.166666666666667*c3)/Ac
        k0[i1*dof+2, i2*dof+3] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(0.166666666666667 - b1*c1/(4*Ac1)) + Ac2*(0.166666666666667 + a2*d2/(4*Ac2)) + 0.166666666666667*Ac3)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(a1*c1/4 - a2*c2/4)/Ac
        k0[i1*dof+2, i2*dof+4] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(-b1*d1/4 + b2*d2/4)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + Ac2*(0.166666666666667 - b2*c2/(4*Ac2)) + 0.166666666666667*Ac3)/Ac
        k0[i1*dof+2, i3*dof+2] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac2*(-b2/(2*Ac2) + 0.166666666666667*(b2 - d2)/Ac2) + Ac3*(d3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b1 - 0.166666666666667*d1)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(Ac2*(a2/(2*Ac2) + 0.166666666666667*(-a2 + c2)/Ac2) + Ac3*(-c3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a1 + 0.166666666666667*c1)/Ac
        k0[i1*dof+2, i3*dof+3] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(0.166666666666667*Ac1 + Ac2*(0.166666666666667 - b2*c2/(4*Ac2)) + Ac3*(0.166666666666667 + a3*d3/(4*Ac3)))/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(a2*c2/4 - a3*c3/4)/Ac
        k0[i1*dof+2, i3*dof+4] += (G44*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G45*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(-b2*d2/4 + b3*d3/4)/Ac + (G45*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2) + G55*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2))*(0.166666666666667*Ac1 + Ac2*(0.166666666666667 + a2*d2/(4*Ac2)) + Ac3*(0.166666666666667 - b3*c3/(4*Ac3)))/Ac
        k0[i1*dof+3, i1*dof+2] += (G44*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G45*(-a1*c1/4 + a3*c3/4))*(Ac1*(d1/(2*Ac1) + 0.166666666666667*(b1 - d1)/Ac1) + Ac3*(-b3/(2*Ac3) + 0.166666666666667*(b3 - d3)/Ac3) + 0.166666666666667*b2 - 0.166666666666667*d2)/Ac + (G45*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G55*(-a1*c1/4 + a3*c3/4))*(Ac1*(-c1/(2*Ac1) + 0.166666666666667*(-a1 + c1)/Ac1) + Ac3*(a3/(2*Ac3) + 0.166666666666667*(-a3 + c3)/Ac3) - 0.166666666666667*a2 + 0.166666666666667*c2)/Ac
        k0[i1*dof+3, i1*dof+3] += (G44*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G45*(-a1*c1/4 + a3*c3/4))*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3)))/Ac + (G45*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G55*(-a1*c1/4 + a3*c3/4))*(-a1*c1/4 + a3*c3/4)/Ac
        k0[i1*dof+3, i1*dof+4] += (G44*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G45*(-a1*c1/4 + a3*c3/4))*(b1*d1/4 - b3*d3/4)/Ac + (G45*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G55*(-a1*c1/4 + a3*c3/4))*(Ac1*(0.166666666666667 - b1*c1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 + a3*d3/(4*Ac3)))/Ac
