        k0[i1*dof+3, i2*dof+4] += (G44*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G45*(-a1*c1/4 + a3*c3/4))*(-b1*d1/4 + b2*d2/4)/Ac + (G45*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + 0.166666666666667*Ac2 + Ac3*(0.166666666666667 - b3*c3/(4*Ac3))) + G55*(-a1*c1/4 + a3*c3/4))*(Ac1*(0.166666666666667 + a1*d1/(4*Ac1)) + Ac2*(0.166666666666667 - b2*c2/(4*Ac2)) + 0.166666666666667*Ac3)/Ac
